import React from "react";
import styled from "styled-components"
import logoUa from "../../images/logoua.png"
import logoEciu from "../../images/logoeciu.png"

const logUa = styled.img`
height: 46px;

  `

const logEciu = styled.img`
height: 46px;

  `


export default () => {

    return (
        <div>
            <logUa>
                <img src={logoUa}  />
            </logUa>

            <logEciu>
                <img src={logoEciu} />
            </logEciu>
        </div>
    )

}
